import React from "react";
import { AppBar, Tab, Tabs, Toolbar } from "@mui/material";
import MenuBookIcon from "@mui/icons-material/MenuBook";

function Header() {
  return (
    <div>
      <AppBar>
        <Toolbar>
          <MenuBookIcon />
          <Tabs textColor="#fff" indicatorColor="#fff" value={0}>
            <Tab label="Add Book" />
            <Tab label="About US" />
          </Tabs>
        </Toolbar>
      </AppBar>
    </div>
  );
}

export default Header;
